import { Link } from 'react-router-dom';
const DUMY_EVENTS = [
    { id: 'e1', title: 'test 1' },
    { id: 'e2', title: 'test 2' },
]
export default function EventDetailPage() {
    return <>
        <h1>Event Details Page</h1>
        <ul>
            {DUMY_EVENTS.map((event => <li key={event.id}><Link to={`/events/${event.id}`}>{event.title}</Link></li>))}
        </ul>
    </>
}
